window.bookSummaryJSON = "<p><i>The Secret</i> revealed the law of attraction. Now Rhonda Byrne reveals the greatest power in the universe: <i>The Power</i> to have anything you want. </p> <p>In this book you will come to understand that all it takes is just one thing to change your relationships, money, health, happiness, career, and your entire life. </p> <p>Every discovery, invention, and human creation comes from <i>The Power</i>. Perfect health, incredible relationships, a career you love, a life filled with happiness, and the money you need to be, do, and have everything you want, all come from <i>The Power</i>. </p> <p>The life of your dreams has always been closer to you than you realized, because <i>The Power</i> - to have everything good in your life - is inside you. </p> <p>To create anything, to change anything, all it takes is just one thing - <i>The Power</i>. </p>"; 
